import React from "react";
import PermMediaIcon from "@mui/icons-material/PermMedia";

const uploadFiles = () => {
  return (
    <div style={{ display: "grid", justifyContent: "center" }}>
      <PermMediaIcon />
    </div>
  );
};

export default uploadFiles;
